/* eslint-disable jsx-a11y/anchor-is-valid */
import NewPage from './NewPage';
import React from 'react';

// import { route, switch } from 'react-router-dom';


import logo1 from './images/image.jpg';
import logo2 from './images/imageb.jpg';
import logo3 from './images/imagec.jpg';
import './App.css';

function App() {

  return (
    <>

      <nav className="navbar  navbar-expand-lg navbar-dark bg-dark">
        <div className="container-fluid">
          <a className="navbar-brand" href="#">Navbar</a>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNavDropdown">
            <ul className="navbar-nav">
              <li className="nav-item">
                <a className="nav-link active" aria-current="page" href="#">Home</a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#"> Work</a>
              </li>
              <li className="nav-item">
              <a className="nav-link" to="/services">Services</a>
            </li>
              <li className="nav-item dropdown">
                <a className="nav-link dropdown-toggle" href="#" id="navbarDropdownMenulink" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                  Services
                </a>
                <ul className="dropdown-menu" aria-labelledby="navbarDropdownMenulink">
                  <li><a className="dropdown-item" href="#">Digital Marketing</a></li>
                  <li><a className="dropdown-item" href="#">Website Development</a></li>
                  <li><a className="dropdown-item" href="#">content writing</a></li>
                </ul>
              </li>
            </ul>
          </div>
        </div>
      </nav>




      <div className="background">
        <div className="content">
          <h1>Welcome to My Website</h1>
          <p>Follow me on social media:</p>
          <a href="https://twitter.com/mytwitter" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-twitter"></i>
          </a>
        </div>
      </div>

      <div
        style={{
          backgroundImage: `url(${logo1})`,
          backgroundSize: '1297px',
          backgroundAttachment: 'fixed',
          height: '100vh',
          position: 'relative',
          /* other CSS styles */
        }}
      >
        <h1>My component with inline background image</h1>
      </div>

      <div className="container2"
      style={{
        backgroundImage: `url(${logo2})`,
        backgroundSize: '1297px',
        backgroundAttachment: 'fixed',
        height: '100vh',
        position: 'relative',
        /* other CSS styles */
      }}
        >
        <img src="images/imageb.jpg" alt="" />
      </div>

      <div
        style={{
          backgroundImage: `url(${logo3})`,
          backgroundSize: '1297px',
          backgroundAttachment: 'fixed',
          height: '100vh',
          position: 'relative',
          /* other CSS styles */
        }}
      >
        <h1>My component with inline background image</h1>
      </div>





    </>
  );
};



export default App;
